column8:
最新の現行プリウス等に純正採用されている市販初、スパイラルアンテナのショートバージョンタイプです。ショート化しながら、通常では問題のない受信感度を実現。ショートアンテナを純正アンテナと交換するだけの簡単取付！<br><br>●全長：102mm ●上部：8φmm ●下部：15φmm ●カラー：ブラック ●5/6φmmアダプター付属 ●スペーサーリング付属（車種によりアンテナ取付口に隙間ができる場合のみに使用します。）<br><br>※装着時に強く締めすぎると破損の恐れがありますのでご注意ください。<br>※山間部や高層ビルの下などでは受信感度が落ちる場合があります。<br><br><br>※こちらの商品はメール便出荷の為、代金引換不可となります。予めご了承くださいませ。<br><br>対応車種：06/10～ L175/185S ムーヴカスタム <br><br>車検対応品<tr><td colspan="2">
